// load the products to the html page
    function loadProductRecords() {
        console.log ('Loading flip flops records from database into #listofproducts ul...');
        db.transaction(function (txs) {
            txs.executeSql('SELECT * FROM FlipFlops ORDER BY name', [], function (txs, results) {
                var len = results.rows.length, i;

                for (i = 0; i < len; i++) {
                    var ProductsLife = results.rows.item(i);

                    var individualProduct = '';
                    individualProduct = '<li><a href="#detailinfo" id="aProductRecord" data-key="' + ProductsLife.id + '" >';
                    individualProduct += '<img height="120" width="120" src="Images/Products/' + ProductsLife.img + '" />';
                    individualProduct += '<h3>' + ProductsLife.name + '</h3>';
                    individualProduct += '<p><strong>Price:</strong> &pound;'+ ProductsLife.price + '<br>';
                    individualProduct += '<strong>Size Available:</strong> ' + ProductsLife.size + '<br>';
                    individualProduct += '<strong>Category:</strong> ' + ProductsLife.cat + '<br>';
                    individualProduct += '<strong>Colours:</strong> ' + ProductsLife.colour + '</p>';
                    individualProduct += '</a></li>';

                    $('#Results').html("Search Results: " + len);
                    $('#listofproducts ul').append(individualProduct);
                    $('#listofproducts ul:visible').listview('refresh');
                } //end for loop
            });
        });
    }

