//this function will send information up to the api
//this feedback form will also contain alot of validation to ensure all data s sent up
function feedback() {

    window.location.href = "#SentFeedback";
//document.addEventListener("deviceready", fetchInfo, false);

//This gets the device deails for ripple
    function getDevice(){
        var element = document.getElementById('device');
        element = 	'Device Name: '     + device.name     +  ", " +
            'Device Platform: ' + device.platform + ", " +
            'Device UUID: '     + device.uuid     + ", " +
            'Device Version: '  + device.version  + ' ';
        $('#device').val(element);
    }

    var name = $("#name").val();
    var email = $("#email").val();
    var comment = $("#textarea").val();
    var device = $("#device").val();

    console.log(name);
    console.log(email);
    console.log(comment);
    console.log(device);

    $.ajax({
        type: "POST",
        url: "http://mobileapi.net78.net/flipflop/postComment/?returntype=xml&key=988233E0-A03A-E969-560F-FC6B6E94E93C&cb=1",
        dataType: "xml",
        data: {
            name: name,
            email: email,
            comment: comment,
            device: device
        },
        success: function(a) {
            console.log(a);
            parseXml(a);
        }
    });
}

function parseXml(a) {

    $(a).find('result').each(function() {
        var message = $(this).find('message').text();
        console.log(message);

        $.mobile.changePage("#validate", {
            transition: "slide",
            reverse: false,
            changeHash: false
        });

        $('#success-message').html(message);

    });
}

function validate() {
    var namebox = document.forms["feedback"]["name"].value;
    var emailbox = document.forms["feedback"]["email"].value;
    var textbox = document.forms["feedback"]["textarea"].value;

    var nametrue = "";
    var emailtrue = "";
    var commenttrue = "";

    if (namebox == null || namebox == "") {
        alert("* Please enter your name");
        return false;
    } else {
        nametrue = "true";
    }

    var atpos = emailbox.indexOf("@");
    var dotpos = emailbox.lastIndexOf(".");

    if (atpos < 1 || dotpos < atpos + 2 || dotpos + 2 >= emailbox.length) {
        alert("* Please enter a valid email address");
        return false;
    } else {
        emailtrue = "true";
    }

    if (textbox == null || textbox == "") {
        alert("* Please enter comments");
        return false;
    } else {
        commenttrue = "true";
    }

    if (nametrue == "true" && emailtrue == "true" && commenttrue == "true") {
        feedback();
    }
}

